response.about:
Люблю общаться с интересными людьми, гулять, развлекаться, фотографироваться и фотографировать. Люблю новые знакомства. По натуре я экстремальный человек.Для меня знакомства это не только повод начать какие то
 отношения.Очень приветствую знакомства просто 
для общения,для получения какой-то новой и интересной информации.Люблю отжигать на клубах, но отжигать в адекватном состоянии.И вообще я живу под звуки ритма.


- Я не рыжая - но почему-то всегда крайняя;
- Я не блондинка - у меня склад ума натуральный;
- Я не кареглазая - глаза у меня ЗЕЛЕНЫЕ, и находятся они выше, чем Вы смотрите;
- Я не пьяница - ведро не выпью - но отхлебну порядочно;
- Я не феминистка - я просто умнее;
- Я Вас не умнее - просто Вы тупее;
- Я не высокомерная - я брезгливая;
- Я не кокетка - я так не умею;
- Я не фригидная - просто у Вас под носом сопля;
- Я не стерва - я просто нетолерантна;
- Я не знаю себе цену - я ни разу ее не называла;
- Я не принцесса - но для некоторых просто подарок;
- Я не стрелочница - я переводчица;
- Я не трусиха - я просто знаю, что дело кончится жопой;
- Я не зануда - я просто знаю, как правильно делать, чтобы не кончилось жопой;
- Я не язвительна - просто, говорю, что думаю;
- Я не люблю гостей - у меня просто коробки, мусор и покрышки в прихожей;
- Я не девка - я девушка, которая дает... в лоб и сильно;
- Я не разгильдяйка - я просто люблю поспать;
- Я не неряха - мне просто мало места в шкафах;
- Я не грязнуля - просто носки легче купить, чем постирать;
- Я не вру - я просто хорошо сочиняю;
- Я Вам не хамлю - я просто использую длинные слова;
- Я над Вами не издеваюсь - я Вас изучаю.
